import React from "react";
import { Link} from "react-router-dom";


const ProtectedRoute = ({ component: Component, ...props }) => {
    return props.loggedIn ? (
        <Component {...props} />
      ) : (
        <Navigate to="./sign-in" />
      );
};

export default ProtectedRoute;
